<?php

class Map_Widget extends WP_Widget {

    public function __construct() {
        $widget_ops = array(
            'classname' => 'map_widget',
            'description' => '',
        );
        parent::__construct('map_widget', 'Map Widget', $widget_ops);
    }

  
    public function form ( $instance ) {
        
        //title
        $title = ! empty( $instance['title'] ) ? $instance['title'] : esc_html__('N/A', 'mp_domain');
        $this->form_group( 'title', $title, 'Title:', 'text' );
        
        //no_cities
        $no_cities = ! empty( $instance['no_cities']) ? $instance['no_cities'] : esc_html__( 0, 'mp_domain' );
        $this->form_group( 'no_cities', $no_cities, 'Number of Cities:', 'number' );

        //map_color
        $map_color = ! empty( $instance['map_color']) ? $instance['map_color'] : esc_html__( '#CCCCCC', 'mp_domain' );
        $this->form_group( 'map_color', $map_color, 'Map Color:', 'text', $map_color );

        //cities_color
        $cities_color = ! empty( $instance['cities_color']) ? $instance['cities_color'] : esc_html__( '#fe3636', 'mp_domain' );
        $this->form_group( 'cities_color', $cities_color, 'City Color:', 'text', $cities_color );

        //cities_color
        $popup_color = ! empty( $instance['popup_color']) ? $instance['popup_color'] : esc_html__( '#ffff99', 'mp_domain' );
        $this->form_group( 'popup_color', $popup_color, 'Popup Color:', 'text' , $popup_color );

        //font_color
        $font_color = ! empty( $instance['font_color']) ? $instance['font_color'] : esc_html__( '#eee', 'mp_domain');
        $this->form_group( 'font_color', $font_color, 'Font Color:', 'text', $font_color );
        
        //city forms
        $cities_data = $this->city_data();
        for ( $i = 0; $i < $no_cities; $i++ ) {
            $field_string = 'city_'. ( $i+1 );
            $field_value = ! empty( $instance[$field_string]) ? $instance[$field_string] : esc_html__( 'N/A', 'mp_domain' );
            $field_string_linktext = $field_string. '_linktext';
            $field_value_linktext = ! empty( $instance[$field_string_linktext]) ? $instance[$field_string_linktext] : esc_html__( 'N/A', 'mp_domain' );
            $field_string_linkurl = $field_string. '_linkurl';
            $field_value_linkurl = ! empty( $instance[$field_string_linkurl]) ? $instance[$field_string_linkurl] : esc_html__( 'N/A', 'mp_domain' );
            $field_string_phone = $field_string. '_phone';
            $field_value_phone = ! empty( $instance[$field_string_phone]) ? $instance[$field_string_phone] : esc_html__( 'N/A', 'mp_domain' );
            $field_string_email = $field_string. '_email';
            $field_value_email = ! empty( $instance[$field_string_email]) ? $instance[$field_string_email] : esc_html__( 'N/A', 'mp_domain' );

            ?><hr/>
            <p>
                <?php $this->form_label( $field_string, "City ". ( $i+1 )); ?>
                <select
                class="widefat"
                id="<?php echo esc_attr( $this->get_field_id($field_string) )?>"
                name="<?php echo esc_attr( $this->get_field_name( $field_string) ); ?>"
                value="<?php echo esc_attr( $field_value); ?>"
                >
                <option value="N/A" <?php if ( empty($field_value) ) echo 'selected';  ?> > N/A</option>
                <?php foreach ($cities_data as $key => $value) {
                    ?>
                    <option 
                        value="<?php echo esc_attr($key) ?>"
                        <?php if ( $field_value == $key ) echo 'selected'; ?>
                        >
                        <?php echo esc_attr($value['city']) ?>
                    </option>
                    <?php
                }
                ?>
                </select>
            </p>
            <p>
                <?php $this->form_label( $field_string_linktext, "City ". ($i+1). " Link Text:")?>
                <?php $this->form_input( $field_string_linktext, $field_value_linktext, 'text')?>
            </p>
            <p>
                <?php $this->form_label( $field_string_linkurl, "City ". ($i+1). " Link Url:")?>
                <?php $this->form_input( $field_string_linkurl, $field_value_linkurl, 'text')?>
            </p>
            <p>
                <?php $this->form_label( $field_string_phone, "City ". ($i+1). " Phone Number:")?>
                <?php $this->form_input( $field_string_phone, $field_value_phone, 'text')?>
            </p>
            <p>
                <?php $this->form_label( $field_string_email, "City ". ($i+1). " Email:")?>
                <?php $this->form_input( $field_string_email, $field_value_email, 'text')?>
            </p>
            <?php
        }
    }

    private function form_group( $field_string, $value, $label_text, $input_type, $color='') {
        ?><p><?php
        $this->form_label( $field_string, $label_text );
        $this->form_input( $field_string, $value, $input_type );
        // if ($color) {
        //     ?> <span style='display: block; width: 100%; padding: 2px; background: <?php echo esc_attr( $color )?>;'></span><?php
        // }
        ?></p><?php
    }

    private function form_label ( $field_string, $label_text ) {
        ?>
            <label for="<?php echo esc_attr( $this->get_field_id( $field_string ) )?>">
                <?php echo esc_attr( $label_text, 'mp_domain') ?>
            </label>
        <?php
    }

    private function form_input ( $field_string, $value, $input_type ) {
        ?>
            <input 
            class="widefat" 
            id="<?php echo esc_attr( $this->get_field_id( $field_string ) ); ?>"
            name="<?php echo esc_attr( $this->get_field_name( $field_string ) ); ?>"
            type="<?php echo esc_attr( $input_type ); ?>"
            value="<?php echo esc_attr( $value ); ?>"
            >
        <?php
    }

    private function update_field( &$instance, &$new_instance, $field_string, $default ) {
        $instance[$field_string] = ( ! empty( $new_instance[$field_string] ) ) ? sanitize_text_field( $new_instance[$field_string] ) : $default;
    }


    public function update($new_instance, $old_instance) {
        $instance = array();
        $this->update_field($instance, $new_instance, 'title', '');
        $this->update_field($instance, $new_instance, 'no_cities', 0);
        $this->update_field($instance, $new_instance, 'map_color', '#CCCCCC');
        $this->update_field($instance, $new_instance, 'city_color', '#fe3636');
        $this->update_field($instance, $new_instance, 'popup_color', '#ffff99');
        $this->upadte_field($instance, $new_instance, 'font_color', '#eee' );
        $n = $instance['no_cities'];
        for ($i = 0; $i < $n; $i++) {
            $field_string = 'city_'. ($i+1);
            $this->update_field($instance, $new_instance, $field_string, '');
            $this->update_field($instance, $new_instance, $field_string. '_linktext', '');
            $this->update_field($instance, $new_instance, $field_string. '_linkurl', '');
            $this->update_field($instance, $new_instance, $field_string. '_phone', '');
            $this->update_field($instance, $new_instance, $field_string. '_email', '');
        }
		return $instance;
    }
    
    public function widget( $args, $instance ) {
        $this->map_svg( $instance );
    }


