    private function cities_svg( $instance ) {
        $city_data = $this->city_data();
        $n = $instance['no_cities'];
        for ($i = 0; $i < $n; $i++) {
            $city = $instance[ 'city_'. ( $i+1 ) ];

            $popup = $instance[ 'city_'. ( $i+1 ). '_linktext' ];
            $url = $instance[ 'city_'. ( $i+1 ). '_linkurl' ];
            $phone = $instance[ 'city_'. ($i+1). '_phone' ];
            $email = $instance[ 'city_'. ($i+1). '_email' ];
            $cd = $city_data[ $city ];
            
            if ( empty( $city ) || empty( $cd ) ) {
                continue;
            }
            
            ?>
                <circle
                    id= "city-<?php echo esc_attr( $i+1 )?>"
                    fill= "<?php echo esc_attr($instance['city_color'])?>"
                    r= "12"
                    stroke= "white"
                    strokeWidth= "1px"
                    class= "city-circle <?php echo $cd ?>"
                    cx="<?php echo esc_attr( $cd[ 'cx' ] ); ?>"
                    cy="<?php echo esc_attr( $cd[ 'cy' ] ); ?>"
                    linktext="<?php echo esc_attr( $popup ); ?>"
                    linkurl="<?php echo esc_attr( $url ); ?>"
                    phone="<?php echo esc_attr($phone); ?>"
                    email="<?php echo esc_attr($email); ?>"
                    popupcolor="<?php echo esc_attr($instance['popup_color'])?>"
                    onmouseover= "cityCircleMouseover(this)"
                    onmouseout= "cityCircleMouseout(this)"
                    onclick= "cityCircleClick(this)"
                >
                </circle>
            <?php
        }
    }

    private function city_data() {
        $json = json_decode( file_get_contents( plugin_dir_path(__FILE__). '/city-data.json'), true );
        $m_city_data = array();
        foreach( $json as $i => $c ) {
            $m_city_data[ strtolower($c['city']) ] = array(
                'city' => $c['city'],
                'cx'   => $this->lng_to_cx($c['lng']),
                'cy'   => $this->lat_to_cy($c['lat']),
            );
        }
        return $m_city_data;
    }

    private function lat_to_cy ( $lat ) {
        //47.27 - 54.92
        return $this->interpolate( 47.27, 54.92, 1360, 60, $lat );
    }

    private function lng_to_cx ( $lng ) {
        //5.96 - 15.02
        return $this->interpolate( 5.96, 15.02, 0, 1000, $lng );
    }

    private function interpolate( $x0, $x1, $f0, $f1, $x ) {
        return (($x - $x0) / ($x1 - $x0)) * ($f1 - $f0) + $f0;
    }

}